/**
 * Login/Signup Page
 */

import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../contexts/AuthContext";
import LoadingSpinner from "../components/LoadingSpinner";
import "../styles/auth.css";

export default function LoginSignup() {
    const [isLogin, setIsLogin] = useState(true);
    const [loading, setLoading] = useState(false);
    const [fullName, setFullName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [showPassword, setShowPassword] = useState(false);
    const navigate = useNavigate();
    const { signIn, signUp } = useAuth();

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);

        try {
            if (isLogin) {
                // Login
                await signIn(email, password);
                navigate("/questionnaire", { replace: true });
            } else {
                // Signup
                await signUp(email, password, { full_name: fullName });
                alert("Signup successful! Please check your email to confirm your account.");
                setIsLogin(true);
                setFullName("");
                setEmail("");
                setPassword("");
            }
        } catch (err) {
            console.error("Auth error:", err);
            alert(err.message || "An error occurred");
        } finally {
            setLoading(false);
        }
    };

    const goToForgotPassword = () => {
        navigate("/forgot-password");
    };

    if (loading) {
        return <LoadingSpinner message={isLogin ? "Logging in..." : "Signing up..."} />;
    }

    return (
        <div className="auth-wrapper">
            <div className="auth-card">
                <h2 className="auth-title">{isLogin ? "Login" : "Signup"}</h2>

                <div className="tab-toggle">
                    <button onClick={() => setIsLogin(true)} className={isLogin ? "active" : ""}>
                        Login
                    </button>
                    <button onClick={() => setIsLogin(false)} className={!isLogin ? "active" : ""}>
                        Signup
                    </button>
                </div>

                <form onSubmit={handleSubmit}>
                    {!isLogin && (
                        <input
                            type="text"
                            placeholder="Full Name"
                            value={fullName}
                            onChange={(e) => setFullName(e.target.value)}
                            className="full-name-input"
                            required
                        />
                    )}
                    <input
                        type="email"
                        placeholder="Email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        required
                    />
                    <input
                        type={showPassword ? "text" : "password"}
                        placeholder="Password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                    />

                    <div className="show-password-wrapper">
                        <input
                            type="checkbox"
                            id="showPassword"
                            checked={showPassword}
                            onChange={() => setShowPassword(!showPassword)}
                        />
                        <label htmlFor="showPassword">Show Password</label>
                    </div>

                    <button type="submit" disabled={loading}>
                        {loading ? "Processing..." : isLogin ? "Login" : "Signup"}
                    </button>
                </form>

                {isLogin && (
                    <p className="forgot-password">
                        <span onClick={goToForgotPassword} className="toggle-link">
                            Forgot password?
                        </span>
                    </p>
                )}

                <p className="toggle-text">
                    {isLogin ? (
                        <>
                            Don't have an account?{" "}
                            <span onClick={() => setIsLogin(false)} className="toggle-link">
                                Signup
                            </span>
                        </>
                    ) : (
                        <>
                            Already have an account?{" "}
                            <span onClick={() => setIsLogin(true)} className="toggle-link">
                                Login
                            </span>
                        </>
                    )}
                </p>
            </div>
        </div>
    );
}
